import React from 'react'
import '../css/Container.css'
const container = () => {

    const data = [
        {
            "name": "Cosmetics",
            "productList": [
                {
                    "name": "Hair Oil",
                    "price": 122
                },
                {
                    "name": "Face wash",
                    "price": 123
                }
            ]
        },
        {
            "name": "Household",
            "productList": [
                {
                    "name": "Hair Oil",
                    "price": 122
                },
                {
                    "name": "Face wash",
                    "price": 123
                }
            ]
        },
        {
            "name":"Electronics",
            "productList": [
                
            ]
        }
    ]

    return (
        <div>
            <h1>Hello</h1>
            <div>
                {data.map((a, nameindex) => {
                    return(
                        <>
                    <div key={a}>
                    </div>
                    
                    <h1>{a.name}</h1>
                    
                    </>
                    )
                })}
                {/* a = full array */}
            </div>
        </div>
    )
}

export default container
